import React from 'react';

export default React.createContext({
    token: null,
    userId: null,
    user: null,
    queries: [],
    mutations: [],
    prevAction1: null,
    prevAction2: null,
    login: (token, userId, tokenExpiration) => {},
    logout: () => {}
});
